import React from "react";
import {
  IconButton,
  InputAdornment,
  Grid,
  DialogContent,
  Paper,
  makeStyles,
  TextField,
  Button,
} from "@material-ui/core";
import { IDialogeDataMobile } from "./appFolder-Interfaces";
import { useSpring, animated } from "react-spring";
import ModalFormSignupError from "./ModalFormSignupError";
import ModalFormLoginError from "./ModalFormLoginError";
import ServerError from "./ServerError";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";
import VisibilityIcon from "@material-ui/icons/Visibility";

function MobileModalLog(DialogeDataMobile: IDialogeDataMobile) {
  ///
  ///
  ///
  ///CREATE A SLIDE UP ANIMATION WITH  REACT SPRING
  const modalanimation = useSpring({
    config: {
      duration: 1000,
    },
    opacity: DialogeDataMobile.showModalForm ? 1 : 0.9,
    transform: DialogeDataMobile.showModalForm
      ? `translateY(0%)`
      : `translateY(100%)`,
  });

  const modalanimationTwo = useSpring({
    config: {
      duration: 900,
    },
    opacity: DialogeDataMobile.showModalForm ? 1 : 0.9,
    transform: DialogeDataMobile.showModalForm
      ? `translateY(0%)`
      : `translateY(100%)`,
  });

  ///
  ///
  ///
  /// MATERIAL UI  CUSTOM STYLES
  var useStyleModal = makeStyles(() => ({
    containerStyle: {
      width: DialogeDataMobile.imageReal,
      height: "auto",
      boxShadow: "0 5px 16px rgba(0, 0, 0, 0.2)",
      color: "#000000",
      position: "relative",
      zIndex: 10,
      borderRadius: DialogeDataMobile.borderGrid,
    },
    imageStyle: {
      opacity: DialogeDataMobile.opacityFixedModalImage,
      cursor: "pointer",
      objectFit: "contain",
      width: "100%",
      height: "100%",
      borderRadius: "0px",
      padding: "0px",
    },
    imageStylex: {
      opacity: DialogeDataMobile.opacitySlidingModalImage,
      cursor: "pointer",
      width: "100%",
      height: "auto",
      borderRadius: "0px",
    },
  }));
  var classes = useStyleModal();
  return (
    <DialogContent
      className="fadermodal FormDialog-container-mobile dontallowhighlighting"
      onClick={DialogeDataMobile.onBackgroundFocus}
      style={{ overflow: "auto", cursor: "pointer", padding: "0px" }}
      ref={DialogeDataMobile.ModalBackgroundRef}
    >
      <Paper
        className={DialogeDataMobile.PaperStyle}
        style={{
          borderRadius: DialogeDataMobile.borderGrid,
          cursor: "default",
        }}
      >
        <Grid container>
          <Grid item xs={12}>
            <img
              onClick={DialogeDataMobile.zoomlogmodal}
              onLoad={DialogeDataMobile.onimageload}
              src={DialogeDataMobile.showimage}
              className={classes.imageStyle}
              alt="Logsmall"
            />
          </Grid>
          <Grid item xs={12} style={{ height: "70vh" }}>
            <Grid xs={12} item className="formholder">
              {DialogeDataMobile.formtype ? (
                <Grid item xs={12} className="" style={{ marginTop: "20px" }}>
                  <ModalFormLoginError
                    type={true}
                    ErrorDisplay={DialogeDataMobile.errorsLoginInputedUsername}
                    darkmode={DialogeDataMobile.darkmode}
                    WidthHolder={DialogeDataMobile.WidthHolder}
                  />

                  <TextField
                    size="small"
                    style={{
                      width: "90%",
                      paddingBottom: "60px",
                    }}
                    inputProps={{ style: { fontSize: "2.5vh" } }}
                    InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                    label="Username"
                    type="text"
                    onChange={DialogeDataMobile.updateLoginvalues}
                    name="inputedUsername"
                    value={DialogeDataMobile.rawLogininputedUsername}
                    variant="filled"
                  />

                  <TextField
                    size="small"
                    style={{
                      width: "88%",
                      paddingBottom: "40px",
                      zIndex: 1,
                    }}
                    inputProps={{ style: { fontSize: "2.5vh" } }}
                    InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                    label="Password"
                    onChange={DialogeDataMobile.updateLoginvalues}
                    type={
                      DialogeDataMobile.loginShowPassword ? "text" : "password"
                    }
                    name="inputedPassword"
                    value={DialogeDataMobile.rawLogininputedPassword}
                    variant="filled"
                    InputProps={{
                      endAdornment: (
                        <InputAdornment position="end">
                          <IconButton
                            onClick={
                              DialogeDataMobile.ShowLoginPasswordForaWhile
                            }
                            onMouseDown={
                              DialogeDataMobile.ShowLoginPasswordForaWhile
                            }
                            aria-label="toggle password visibility"
                          >
                            {DialogeDataMobile.loginShowPassword ? (
                              <VisibilityIcon />
                            ) : (
                              <VisibilityOffIcon />
                            )}
                          </IconButton>
                        </InputAdornment>
                      ),
                    }}
                  />
                  <ModalFormLoginError
                    type={false}
                    ErrorDisplay={DialogeDataMobile.errorsLoginInputedPassword}
                    darkmode={DialogeDataMobile.darkmode}
                    WidthHolder={DialogeDataMobile.WidthHolder}
                  />

                  <Grid container style={{ marginTop: "40px", zIndex: 300 }}>
                    <Grid item xs={4}></Grid>
                    <Grid item className="buttonpad buttonshake" xs={4}>
                      <Button
                        onClick={DialogeDataMobile.logmein}
                        className={DialogeDataMobile.loginclass}
                        fullWidth={true}
                        variant="outlined"
                        size="large"
                        color="primary"
                      >
                        Log In
                      </Button>
                    </Grid>{" "}
                  </Grid>
                </Grid>
              ) : (
                <Grid item xs={12} className="" style={{ marginTop: "20px" }}>
                  <ModalFormSignupError
                    ErrorType={0}
                    textField="email"
                    errorFormChecking={
                      DialogeDataMobile.errorFormCheckinginputedEmail
                    }
                    WidthHolder={DialogeDataMobile.WidthHolder}
                    darkmode={DialogeDataMobile.darkmode}
                    type={true}
                    cantPassBadEmail={DialogeDataMobile.cantPassBadEmail}
                    ErrorDisplay={DialogeDataMobile.emailErrorDisplay}
                    ErrorData={DialogeDataMobile.emailErrorData}
                  />
                  <TextField
                    size="small"
                    style={{
                      width: "90%",
                      paddingBottom: "32px",
                    }}
                    inputProps={{ style: { fontSize: "2.5vh" } }}
                    InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                    label="Email"
                    type="email"
                    onChange={DialogeDataMobile.updateSignvalues}
                    name="inputedEmail"
                    value={DialogeDataMobile.rawSignupValuesinputedEmail}
                    variant="filled"
                  />
                  <ModalFormSignupError
                    ErrorType={
                      DialogeDataMobile.errorsSignupValuesinputedUsername
                    }
                    textField="username"
                    errorFormChecking={
                      DialogeDataMobile.errorFormCheckinginputedUsername
                    }
                    WidthHolder={DialogeDataMobile.WidthHolder}
                    darkmode={DialogeDataMobile.darkmode}
                    type={true}
                    cantPassBadEmail={DialogeDataMobile.cantPassBadEmail}
                    ErrorDisplay={DialogeDataMobile.usernameErrorDisplay}
                    ErrorData={DialogeDataMobile.usernameErrorData}
                  />
                  <TextField
                    size="small"
                    style={{
                      width: "90%",
                      paddingBottom: "45px",
                    }}
                    inputProps={{ style: { fontSize: "2.5vh" } }}
                    InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                    label="Username"
                    type="text"
                    onChange={DialogeDataMobile.updateSignvalues}
                    name="inputedUsername"
                    value={DialogeDataMobile.rawSignupValuesinputedUsername}
                    variant="filled"
                  />

                  <TextField
                    size="small"
                    style={{
                      width: "90%",
                      paddingBottom: "30px",
                      zIndex: 1,
                    }}
                    inputProps={{ style: { fontSize: "2.5vh" } }}
                    InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                    label="Password"
                    type={
                      DialogeDataMobile.signupShowPassword ? "text" : "password"
                    }
                    onChange={DialogeDataMobile.updateSignvalues}
                    name="inputedPassword"
                    value={DialogeDataMobile.rawSignupValuesinputedPassword}
                    variant="filled"
                    InputProps={{
                      endAdornment: (
                        <InputAdornment position="end">
                          <IconButton
                            onClick={
                              DialogeDataMobile.ShowSignupPasswordForaWhile
                            }
                            onMouseDown={
                              DialogeDataMobile.ShowSignupPasswordForaWhile
                            }
                            aria-label="toggle password visibility"
                          >
                            {DialogeDataMobile.signupShowPassword ? (
                              <VisibilityIcon />
                            ) : (
                              <VisibilityOffIcon />
                            )}
                          </IconButton>
                        </InputAdornment>
                      ),
                    }}
                  />
                  <ModalFormSignupError
                    ErrorType={0}
                    textField="password"
                    errorFormChecking={
                      DialogeDataMobile.errorFormCheckinginputedPassword
                    }
                    darkmode={DialogeDataMobile.darkmode}
                    WidthHolder={DialogeDataMobile.WidthHolder}
                    type={false}
                    cantPassBadEmail={DialogeDataMobile.cantPassBadEmail}
                    ErrorDisplay={DialogeDataMobile.passwordErrorDisplay}
                    ErrorData={DialogeDataMobile.passwordErrorData}
                  />

                  <Grid container className="modal-hold-signup">
                    <Grid item xs={4}></Grid>
                    <Grid item className="buttonpad buttonshake" xs={4}>
                      <Button
                        className={DialogeDataMobile.signupclass}
                        onClick={DialogeDataMobile.signmeup}
                        fullWidth={true}
                        variant="contained"
                        size="large"
                        color="secondary"
                      >
                        Sign Up
                      </Button>
                    </Grid>{" "}
                  </Grid>
                </Grid>
              )}
            </Grid>
          </Grid>
        </Grid>
      </Paper>
    </DialogContent>
  );
}

